import React, { useEffect } from 'react'

export default function Table1({data}) {
  useEffect(
    (data) => {
      let tr = ""
      data.map((v)=>{
         tr += `<tr><td></td><td>${v.name}</td><td>${v.age}</td><td>${v.email}</td><td><button type="button" class="btn btn-primary">update</button></td><button type="button" class="btn">delete</button></tr>`
      })

    },[data]
  )
  return (
    <table className="table table-hover">
    <thead>
    <tr>
        <th>S.no</th>
        <th>Name</th>
        <th>Age</th>
        <th>Email</th>
        <th>Edit</th>
        <th>Remove</th>
    </tr>
    </thead>
    <tbody>

    </tbody>
  </table>
  )
}
